import { Link } from "react-router-dom";
import { useSelector} from "react-redux";
import * as selectors from '../../redux/users/user-selector'
import s from './List.module.css'
import { useState } from "react";

// import { Button } from "@mui/material";
export default function List() {
    const repositories = useSelector(selectors.getState);
    const [isClicked,setIsCliked]=useState('false')
    return (
        <div className={s.card_container}>
            <ul className={s.gallery__list}>{repositories.map((repo) => (<li key={repo.id} className={ s.gallery__list__elem} >
                <div className={s.img__thumb}>
                <img className={s.img} src={repo.owner.avatar_url} alt='dfsdf' />
                </div>
            <p className={s.name}>Repository name -- {repo.name}</p>
            <p className={s.name}>Repository rating --{repo.stargazers_count}</p>
            <div className={s.cont}>
            <Link  className={s.button} to={`/search/${repo.id}`}>View More</Link>
            <button className={s.button}  type='button'>Add to favorite</button>
            </div>
        </li>))}
        </ul>
        </div>
    );}
